import './App.scss';
import triangles from './assets/triangles.svg';

function App() {
  return (
    <div className="App">

      <header className="App-header">
        <div className="Intro">
          <div className="Tri-Poly">
            <img src={triangles}></img>
          </div>

          <div className="Welcome">
            Welcome to my website.
          </div>
        </div>




      </header>
    </div>
  );
}

export default App;
